// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract StructDemo {
  struct Payment {
    uint amount;
    uint timestamp;
  }
  struct Balance {
    uint totalBalance;
    uint numPayments;
    mapping(uint => Payment) payments;
  }
  mapping(address => Balance) public balanceReceived;
}

